  }

};

export default class NavBar extends Component {
  render() {
    return (
      <div id="Nav-Bar">
        <AppBar position="static" >
          <Toolbar style={styles.navBar}>
            <div id="title" >
              <h2>E-Commerce Solutions</h2>
            </div>
            <div id="actions">

              <LocationOnIcon/>

              <SearchIcon/>
              <ShoppingCartIcon/>
              <AccountCircleIcon/>
            </div>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}
